import { initialState } from "./constants";
import { actions } from "./actions";

const reducer = (state, action)=>{
    switch(action.type) {
        case actions.CLICK_NUMBER:
            alert('Gu');
            return state;

        default:
            return state;
    }
};
export {reducer, actions, initialState};
